import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { StudentDashboardComponent } from './VT_Section/student-dashboard/student-dashboard.component';
import { VTComponent } from './VT_Section/vt_login/vt.component';

@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    StudentDashboardComponent,
    VTComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule,
    HttpClientModule,
    RouterModule.forRoot([
      { path: 'student_dashboard', component:StudentDashboardComponent, pathMatch: 'full' },
       { path: '', component: VTComponent },
       { path: 'vt', component: VTComponent },
    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
